import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import Counter from './counter';

const  App = () => {
  return (
    <View style={styles.container}>
      <Text></Text>
      <Counter/>
    </View>
  )
}

export default App

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
